public class Solution {

    static String twoStrings(String s1, String s2){

    	Instant cp1 = Instant.now();
    	System.out.println("CheckPoint#1: " + cp1.toString());
    	
    	Map<String, Integer> firstMap = new HashMap<>();
    	
    	// populate first map
    	int s1Len = 0;
   		s1Len = s1.length();
    	for(int i = 0; i < s1Len; i++) {
    		String s = s1.substring(i, i + 1);
    		Integer freq = firstMap.get(s);
    		firstMap.put(s, (freq == null)? 1: freq + 1);
    	}
    	
    	Instant cp2 = Instant.now();
    	System.out.println("CheckPoint#2: " + cp2.toString());
    	Duration d1 = Duration.between(cp1, cp2);
    	System.out.println("Duration#1: " + d1.toMillis() + " milliseconds");
    	
    	Map<String, Integer> secondMap = new HashMap<>();

    	Instant cp3 = Instant.now();
    	System.out.println("CheckPoint#3: " + cp3.toString());
    	
    	// populate second map
    	int s2Len = 0;
   		s2Len = s2.length();
   		for(int i = 0; i < s2Len; i++) {
   			String s = s2.substring(i, i + 1);
   			Integer freq = secondMap.get(s);
   			secondMap.put(s, (freq == null)? 1: freq + 1);
    	}    	   	
    	
   		Instant cp4 = Instant.now();
   		System.out.println("CheckPoint#4: " + cp4.toString());
   		Duration d2 = Duration.between(cp3, cp4);
   		System.out.println("Duration#2: " + d2.toMillis() + " milliseconds");
   		Duration d3 = Duration.between(cp1, cp4);
   		System.out.println("Total Duration: " + d3.toMillis() + " milliseconds");
   		
   		if(firstMap.size() < secondMap.size()) {
   			for(String s: firstMap.keySet()) {
   				if(secondMap.containsKey(s)) {
   					return "YES";
   				}
   			}
   		}
   		else {
   			for(String s: secondMap.keySet()) {
   				if(firstMap.containsKey(s)) {
   					return "YES";
   				}
   			}   			
   		}

   		Instant cp5 = Instant.now();
   		System.out.println("CheckPoint#5: " + cp5.toString());
   		Duration d4 = Duration.between(cp4, cp5);
   		System.out.println("Duration#3: " + d4.toMillis() + " milliseconds");
   		Duration d5 = Duration.between(cp1, cp5);
   		System.out.println("Total Duration: " + d5.toMillis() + " milliseconds");   		
   		
   		
   		return "NO";
    }

    public static void main(String[] args) {

    	String s1 = "";
        String s2 = "world";
        String result = twoStrings(s1, s2);
        System.out.println(result);
    }
}